import React from "react";
import { Star } from "@material-ui/icons";
const RatingsFilterItems = ({ starRatingNum, onStarSelect }) => {
  return (
    <ul>
      {starRatingNum.map((ratingNum, i) => (
        <li key={i} className="ratings__dropdonw-items p-2">
          <div>
            <input
              type="checkbox"
              className="mr-2"
              onChange={e => onStarSelect(e)}
            />{" "}
            {ratingNum}{" "}
          </div>{" "}
          <span className="ml-2">
            {Array(ratingNum).fill(
              <Star fontSize={"small"} color={"secondary"} />
            )}
          </span>
        </li>
      ))}
    </ul>
  );
};

export default RatingsFilterItems;
